    @Before
    override fun setUp() {
        super.setUp()
        testAppComponent.inject(this)

        fullTournament1 = gson.fromJson(JSON_FULL_TOURNAMENT_1, FullTournament::class.java)
        fullTournament2 = gson.fromJson(JSON_FULL_TOURNAMENT_2, FullTournament::class.java)
        fullTournament3 = gson.fromJson(JSON_FULL_TOURNAMENT_3, FullTournament::class.java)
    }

    @Test
    fun testPrepareNull() {
        var ft: FullTournament? = null

        val callback = object : FullTournamentUtils.Callback {
            override fun onComplete(fullTournament: FullTournament?) {
                ft = fullTournament
            }
        }

        fullTournamentUtils.prepareFullTournament(null, callback)
        assertNull(ft)
    }

    @Test
    fun testPrepareFullTournament1() {
        var ft: FullTournament? = null

        val callback = object : FullTournamentUtils.Callback {
            override fun onComplete(fullTournament: FullTournament?) {
                ft = fullTournament
            }
        }

        fullTournamentUtils.prepareFullTournament(fullTournament1, callback)
        assertNotNull(ft)
        assertEquals(fullTournament1, ft)

        assertEquals("666", ft?.players?.get(0)?.name)
        assertEquals("ALLNITTE", ft?.players?.get(1)?.name)
        assertEquals("asianson", ft?.players?.get(2)?.name)
        assertEquals("Zorc", ft?.players?.get(42)?.name)
    }

    @Test
    fun testPrepareFullTournament2() {
        var ft: FullTournament? = null

        val callback = object : FullTournamentUtils.Callback {
            override fun onComplete(fullTournament: FullTournament?) {
                ft = fullTournament
            }
        }

        fullTournamentUtils.prepareFullTournament(fullTournament2, callback)
        assertNotNull(ft)
        assertEquals(fullTournament2, ft)

        assertEquals("1stChristian", ft?.players?.get(0)?.name)
        assertEquals("4AM", ft?.players?.get(1)?.name)
        assertEquals("Ace", ft?.players?.get(2)?.name)
        assertEquals("Zbert", ft?.players?.get(98)?.name)
        assertEquals("Zoap", ft?.players?.get(99)?.name)
    }

    @Test
    fun testPrepareFullTournament3() {
        var ft: FullTournament? = null

        val callback = object : FullTournamentUtils.Callback {
            override fun onComplete(fullTournament: FullTournament?) {
                ft = fullTournament
            }
        }

        fullTournamentUtils.prepareFullTournament(fullTournament3, callback)
        assertNotNull(ft)
        assertEquals(fullTournament3, ft)
        assertTrue(ft?.players.isNullOrEmpty())
    }

